import { NavLink, BrowserRouter, Route, Routes } from 'react-router-dom';
import React from 'react';
import img_logo from "./img/logo.png";
import './Home.css';



const Home = () => {
    return (        
        <div className="Home">
            <header className='Home-header'>            
                <NavLink to={"Login.js"}>
                < img src={img_logo} className="Home-image"/>                    
                </NavLink>
            </header>

        </div>    
    );
};

export default Home;
